from typing import Listfrom db import Transactionsfrom db.dto import GroupDtofrom utils import generate_unique_idclass Group(Transactions):	def __init__(self, unique_id: str = None, name: str = None, mentor_id: str = None):		super().__init__()		self.id = unique_id or generate_unique_id()		self.name = name		self.mentor_id = mentor_id		def create_group(self):		sql: str = 'insert into groups(id, name, mentor_id) values (?,?,?)'		params = (self.id, self.name, self.mentor_id)		return self.execute(sql, params, commit=True)		def select_group(self):		sql: str = 'select name,id from groups'		groups = self.execute(sql, fetchall=True)		_: List[GroupDto] = []		for group in groups:			_.append(GroupDto(group[0], group[1]))		return _